import React from "react";

const Cell = props => {
  let renderCell = () => {
    if (props.data.is_revealed) {
      if (props.data.is_mine === true) {
        return <div className="cell open">m</div>;
      } else if (props.data.neighbour_mine_count === 0) {
        return <div className="cell open" />;
      } else
        return (
          <div className="cell open">{props.data.neighbour_mine_count}</div>
        );
    } else if (props.data.is_flagged === true) {
      return (
        <div
          className="cell"
          onContextMenu={e => {
            e.preventDefault();
            props.flagCell(props.data);
          }}
        >
          <span>
            <i class="flag checkered icon" />
          </span>
        </div>
      );
    } else {
      return (
        <div
          className="cell"
          onContextMenu={e => {
            e.preventDefault();
            props.flagCell(props.data);
          }}
          onClick={() => props.openCell(props.data)}
        />
      );
    }
  };

  return renderCell();
};

export default Cell;
